import React, { useEffect, useState } from 'react';


class MyComponentRest extends Component{
    constructor(props){
        super(props)
        this.state = {
            hello: 'Hola Mundo'
        }
    }
    render(){
        return(
            <h1>this.state.hello</h1>
        )
    }
}

export default MyComponentRest;
